import React from 'react';
import '..UI/C'

function Card(props){
    // wrapper co ponents 
    // props.children is used to set all the child elements in the main div .
   // return <div className="card-container">{props.children}</div>
    
   const classes = 'card-container '+ props.className;  // to add other classes properties also and this class style properties .
   return <div className={classes}>{props.children}</div>
}
export default Card;
